import React from 'react'
import { Row } from 'react-bootstrap'
import CardMovie from './CardMovie'

const Movieslist = ({moviess}) => {
  return (
    <Row>
    {
        moviess.lenght >=1?(moviess.map((mov)=>{
            return(
                <CardMovie key={mov.id} mov={mov}/>

            )
        })):<h2>no</h2>
    }
    
    </Row>
  )
}

export default Movieslist
